import React from 'react';
import Typewriter from 'typewriter-effect';

function Hero() {
  const strings = ['Rent a place', 'Sell a place', 'Offer services'];

  return (
    <div className='text-white'>
      <div className='max-w-[800px] mt-[-96px] w-full mx-auto h-screen text-center flex flex-col justify-center'>
        <p className='text-amber-400 font-bold p-2'>Hey, Welcome to UrbanRoost</p>
        <div className='flex justify-center items-center my-4'>
          <p className='md:text-5xl sm:text-4xl text-xl font-bold'>Want to </p>
          <Typewriter
        onInit={(typewriter) => {
          // Type the first string, pause for 1 second, delete all, type the second string, and start
          typewriter
            .typeString('GeeksForGeeks') // Type "GeeksForGeeks"
            .pauseFor(1000) // Pause for 1 second
            .deleteAll() // Delete all characters
            .typeString('Welcomes You') // Type "Welcomes You"
            .start(); // Start the animation
        }}
      />        </div>
        <button className='bg-amber-400 rounded-xl w-[200px] py-1 my-5 mx-auto text-black'>Get Started</button>
      </div>
    </div>
  );
}

export default Hero;
